    def parse_links(self):
        texto = '\n'.join([line for line in open('links_trf2.txt','r')])
        soup = BeautifulSoup(texto,'lxml')
        for script in soup(["script", "style"]):
            script.extract()
        arq = open('texto_links_trf2.txt','w')
        arq.write(soup.get_text())
        arq.close()

